// src/components/ProductCard.jsx
import React from "react";

function ProductCard({ product }) {
  return (
    <div className="flex justify-center items-center h-24">
      <img
        src={product.image}
        alt={product.name}
        className="w-16 h-16 object-contain"
      />
    </div>
  );
}

export default ProductCard;
